import actiontypes from '../actiontypes';

const initState = {
    isAutheticated: false
}

const authReducer = ( state = initState, action) => {
   
    switch(action.type) {
        case actiontypes().auth.login:
            state.is

        default:
            return state
    }
}

export default authReducer;
